      <h1>Cadastro</h1>
       
      
      <form>
        <div className="promotion-form__group">
          <label>Nome:</label>
          <input id="name" name="name" type="text"/>
        </div>
        <br></br>
        <div className="promotion-form__group">
          <label>Senha:</label>
          <input id="password" name="password" type="password"/>
        </div>
        <br></br>
        <div className="promotion-form__group">
          <label>E-mail:</label>
          <input id="email" name="email" type="text"/>
        </div>
        <br></br>
        <div className="promotion-form__group">
          <label>Cpf:</label>
          <input id="cpf" name="cpf" type="text"/>
        </div>
        <br></br>
        <div className="promotion-form__group">
          <label>CRM:</label>
          <input id="crm" name="crm" type="text"/>
        </div>
        <br></br>
        <div className="promotion-form__group">
          <label>Telefone1:</label>
          <input id="phoneOne" name="phoneOne" type="text"/>
        </div>
        <br></br>
        <div className="promotion-form__group">
          <label>Telefone2:</label>
          <input id="phoneTwo" name="phoneTwo" type="text"/>
        </div>
      </form>

    </div>
    );
  }
